import React from "react";
import { Box, Typography, Button ,Container,TextField} from "@mui/material";


export const Home = () => {
  return (
    <>
      <Box sx={{ backgroundColor: "dark", color: "light", py: 5 }}>
        <Box sx={{ maxWidth: "lg", mx: "auto", px: 3 }}>
          <Box
            sx={{
              display: "flex",
              flexDirection: { xs: "column", sm: "row" },
              alignItems: "center",
              justifyContent: "space-between",
            }}
          >
            {/* Text Section */}
            <Box>
              <Typography
                variant="h1"
                sx={{ fontSize: { xs: "2rem", sm: "3rem" } }}
              >
                Become <span style={{ color: "#ffc107" }}>Web Developer</span>
              </Typography>
              <Typography variant="body1" sx={{ my: 4 }}>
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Iusto,
                earum quaerat? Ducimus, sequi debit nisi voluptatem non itaque
                doloribus, numquam mollitia fugiat illo a et ipsa dolor? Hic,
                quos debitis?
              </Typography>
              <Button
                variant="contained"
                color="primary"
                size="large"
                onClick={() => {
                  /* Open modal logic */
                }}
              >
                Start The Enrollment
              </Button>
            </Box>

            {/* Image Section */}
            <Box
              component="img"
              src="/Images/main icon.png"
              alt="Main Icon"
              sx={{
                width: "25%",
                display: { xs: "none", sm: "block" },
              }}
            />
          </Box>
        </Box>
      </Box>


      {/* // -------------- -------------------*/}
      <Box sx={{ backgroundColor: "primary.main", color: "white", py: 5 }}>
        <Container>
          <Box
            sx={{
              display: "flex",
              flexDirection: { xs: "column", md: "row" },
              alignItems: "center",
              justifyContent: "space-between",
            }}
          >
            <Typography variant="h3" sx={{ mb: { xs: 3, md: 0 } }}>
              Sign Up For Our Newsletter!
            </Typography>

            <Box sx={{ display: "flex", mb: 3 }}>
              <TextField
                label="Enter Email Address"
                variant="outlined"
                sx={{ backgroundColor: "white", borderRadius: 1 }}
                InputProps={{
                  sx: { padding: "10px" },
                }}
              />

              <Button
                variant="contained"
                color="secondary"
                size="large"
                sx={{ ml: 2 }}
              >
                Button
              </Button>
            </Box>
          </Box>
        </Container>
      </Box>

      <CardSection />
    </>
  );
};
